+
+    public static boolean oneOrFourInTheArray(Integer[] integers){
+        boolean isOne = false;
+        boolean isFour = false;
+        for (int i = 0; i <= integers.length-1; i++) {
+            if (integers[i]==1){
+                isOne = true;
+            }else if (integers[i]==4){
+                isFour = true;
+            } else return false;
+        }
+        return isOne && isFour;
+    }
